お手入れ簡単！水タンク一体型、フッ素加工「広口内容器」「フィルター不要」<br>広口なので給水、お手入れが簡単。またフッ素加工内容器なので汚れがこびりつきにくくなっています。お手入れが面倒なフィルターが無い構造です。<br><br>●清潔な蒸気のスチーム式<br>沸とうさせたきれいな蒸気を約65℃まで冷ましてお部屋を加湿します。<br><br>●Wセンサーが湿度を自動コントロール「自動加湿3段階」<br>「湿度センサー」「室温センサー」のWセンサーが快適な湿度を自動コントロール。「高め」「標準」「ひかえめ」と3段階選択できます。<br>空気が乾燥する冬の時期には「高め」運転、秋口などおだやかに加湿したい時は「ひかえめ」運転がおすすめです。<br><br>●トリプル安心設計「チャイルドロック」「ふた開閉ロック」「転倒湯もれ防止構造」<br>チャイルドロック<br>キーを3秒押しするだけですべての操作ができなくなります。<br>※安全のため「切」キーを押すと運転が停止します。<br><br>ふた開閉ロック<br>レバーでふたを常にロックしているので転倒しても簡単に開かないようになっています。<br><br>転倒湯もれ防止構造<br>本体をうっかり倒しても湯もれを最小限に抑えます。<br>※フタがしっかりと閉まっていることをご確認ください。<br>※本体を倒れたまま放置されますと、蒸気口から微量のお湯が流れ出ます。<br><br>●お部屋の状態がひと目で分かる「湿度モニター」<br>「低湿」「適湿」「高湿」とお部屋の状態がランプによりひと目で確認できます。<br><br>●運転時間の目安に合わせて給水できる「水位線」つき<br><br>●沸とう音を軽減する「湯沸かし音セーブモード」<br>ご使用中に湯沸かし音が気になる場合、水の温度をゆっくりあげ、湯沸かし音を小さくします。<br><br>●所をとらない水タンク一体型「コンパクト設計」<br><br>●便利なダブルタイマー「切タイマー2時間」「入タイマー6時間」<br><br>●清潔「Ag+抗菌加工ハンドル」<br><br><br>連続運転/強・弱の2段階(35サイズ 連続加湿時間 【強】約6時間、【弱】約27時間)<br>スチーム温度/約65℃<br>クエン酸洗浄<br>空だき防止<br>転倒時自動オフ<br>マグネットプラグ<br>ブザー報知<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：象印<br>消費電力W：湯沸かし時/985・加湿時/305<br>加湿時間(h)：強連続/6 弱連続/27<br>外形寸法：240×260×275mm<br>質量：2.3kg<br><br>購入単位：1台<br>配送種別：在庫品</p></td></tr></table><br><img src=http://image.rakuten.co.jp/onestep/cabinet/parts/gentei.jpg alt=数量限定><br><font color=#FF0000>※数量限定のため、先着順での販売となります。<br> ご注文のタイミングによっては、完売となっている場合がございます。<br> その際はキャンセル扱いとさせていただきますので、予めご了承下さい。</font><br><br><br><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>FM9720 fm9720 4974305212757 象印スチーム式加湿器EE-RL35 EE-RL35 ee-rl35 象印 ぞうじるし ゾウジルシ ZOJIRUSHI zojirushi スチーム式加湿器 すちーむかしつき スチームカシツキ スチームかしつき すちーむカシツキ スチーム すちーむ suti-mu 水タンク一体型 一体型 フッ素加工 ふっそかこう 広口内容器 フィルター不要 ふぃるたーふよう お手入れ簡単 おていれかんたん 自動加湿 じどうかしつ 3段階 さんだんかい チャイルドロック ちゃいるどろっく ふた開閉ロック ふたかいへいろっく 転倒湯もれ防止構造 湿度モニター 水位線 水位線つき 湯沸かし音セーブモード セーブモード 沸とう音軽減 コンパクト コンパクト設計 ダブル ダブルタイマー 切タイマー 切タイマー2時間 入タイマー 入タイマー6時間 Ag+ こうきん こうきんかこう コウキン コウキンカコウ 抗菌加工 抗菌加工ハンド